  [],\n\t\"revision_timestamp\": \"2015-05-06T21:06:41.885212\",\n\t\"name\": \"ultra-low-power-mems-selective-gas-sensors-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"KWJ offers this proposal for a very low
  power but very practical \"nano-watt\" MEMS sensor platform for NASA requirements.
  The proposed nano-sensor platform is ultra low power and has a long sensor lifetime
  for extended battery life or power-harvester operation. The extremely fast response
  time of the sensor (&lt;100 nsec) will be utilized in this SBIR as a possible new
  and innovative avenue to create selectivity for TCDs. This approach would only be
  available to very fast detectors like the new KWJ MEMS detector. The sensor is a
  platform technology designed for multiple analyte measurement on a single chip.
  \ In addition to cryogenic system leak detection for CH4, H2, and He, the platform
  can address trace levels of N2, O2, and H20 in gaseous helium purge streams. The
  SBIR project creates products and spin offs for NASA, industrial, and medical applications.\",\n\t\"license_title\":
